import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'sound-collection';
}
<div class="banner">
  <h2 class="sound">Sound Collection</h2>
</div>
<div class="spacer">
  <ul>
    <li><a href="animal">Animals</a></li>
    <li><a href="bird">Birds</a></li>
    <li>Reptiles</li>
  </ul>
</div>

<router-outlet>
</router-outlet>
